/category/non-classe/\">Non classé</a>\r\n</li>\r\n							</ul>\r\n												</nav>\r\n					\r\n					\r\n					\r\n					\r\n					<div id=\"et_mobile_nav_menu\">\r\n				<div class=\"mobile_nav closed\">\r\n					<span class=\"select_page\">Sélectionner une page</span>\r\n					<span class=\"mobile_menu_bar mobile_menu_bar_toggle\"></span>\r\n				</div>\r\n			</div>				</div> <!-- #et-top-navigation -->\r\n			</div> <!-- .container -->\r\n					</header> <!-- #main-header -->\r\n			<div id=\"et-main-area\">\r\n	\r\n<div id=\"main-content\">\r\n\r\n\r\n			\r\n				<article id=\"post-177\" class=\"post-177 page type-page status-publish hentry\">\r\n\r\n				\r\n					<div class=\"entry-content\">\r\n					<div id=\"et-boc\" class=\"et-boc\">\r\n			\r\n		<div class=\"et-l et-l--post\">\r\n			<div class=\"et_builder_inner_content et_pb_gutters3\">\r\n		<div class=\"et_pb_section et_pb_section_0 et_pb_with_background et_section_regular\" >\r\n				\r\n				\r\n				\r\n				\r\n					<div class=\"et_pb_row et_pb_row_0\">\r\n				<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_0  et_pb_css_mix_blend_mode_passthrough et-last-child\">\r\n				\r\n				\r\n				<div class=\"et_pb_module et_pb_text et_pb_text_0  et_pb_text_align_left et_pb_bg_layout_light\">\r\n				\r\n				\r\n				<div class=\"et_pb_text_inner\"><h1>Test JS sur Divi</h1></div>\r\n			</div>\r\n			</div>\r\n				\r\n				\r\n			</div>\r\n				\r\n				\r\n			</div><div class=\"et_pb_section et_pb_section_1 et_section_specialty\" >\r\n				\r\n				\r\n				\r\n				<div class=\"et_pb_row\">\r\n					<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_1    et_pb_css_mix_blend_mode_passthrough\">\r\n				\r\n				\r\n				<div class=\"et_pb_module et_pb_code et_pb_code_0  et_pb_text_align_center\">\r\n				\r\n				\r\n				<div class=\"et_pb_code_inner\"><h1 id=\"cookie\">\r\n  0 Cookie\r\n</h1></div>\r\n			</div><div class=\"et_pb_module et_pb_code et_pb_code_1  et_pb_text_align_center\">\r\n				\r\n				\r\n				<div class=\"et_pb_code_inner\"><button style=\'width:200px;height:200px;\' onclick=\'clickmanuel()\'>\r\n  cookie\r\n</button>\r\n<script>\r\n  function clickmanuel(){\r\n    nb = nb +1;\r\n    affiche();\r\n\r\n}\r\n// initialiserles variable\r\n  // nb de cookie\r\n  var nb = 0;\r\n  \r\n  // nb d\'achat\r\n  var autoc = 0\r\n  var mamic = 0\r\n  var fermec = 0\r\n  var usinec = 0\r\n\r\n  //update 1.1\r\n  var factoryc = 0\r\n  var centrepc = 0\r\n  var atomec = 0\r\n  var planetc = 0\r\n  //-------------------------------------------\r\n  // prix en plus\r\n  var autoadd = 10 // 1/sec\r\n  var mamiadd = 50 // 5/sec\r\n  var fermeadd = 1000 // 10/sec\r\n  var usineadd = 10000 // 100/sec\r\n  \r\n  // update 1.1\r\n  var factoryadd = 50000\r\n   var centrepadd = 1000000\r\n   var atomeadd = 10000000\r\n   var planetadd = 1000000000\r\n   //-------------------------------------------\r\n  // variable objectif\r\n  var objmami = 0;\r\n  var objferme = 0;\r\n  var objusine = 0;\r\n  \r\n  //update 1.1\r\n  var objfactory = 0;\r\n  var objcentrep = 0;\r\n  var objatome = 0;\r\n  var objplanet = 0;\r\n  \r\n\r\n  // afficher les modification / update\r\n  function affiche(){\r\n    let nbc = autoc+(mamic*5)+(fermec*10)+(usinec*100)+(factoryc*500)+(centrepc*1000)+(atomec*10000)+(planetc*1000000);     document.getElementById(\'Afnbc\').innerHTML= nbc + \" Cookies / sec\";\r\n    // affiche le nombre de cookies\r\n    document.getElementById(\'cookie\').innerHTML= nb + \" cookies\";\r\n    // affiche le nb d\'achat pour chacun\r\n    \r\n    document.getElementById(\'Afauto\').innerHTML= autoc + \" acheter\";\r\n    document.getElementById(\'Afmami\').innerHTML= mamic + \" acheter\";\r\n    document.getElementById(\'Afferme\').innerHTML= fermec + \" acheter\";\r\n    document.getElementById(\'Afusine\').innerHTML= usinec + \" acheter\";\r\n\r\n    document.getElementById(\'Affactory\').innerHTML= factoryc + \" acheter\";\r\n    document.getElementById(\'Afcentrep\').innerHTML= centrepc + \" acheter\";\r\n    document.getElementById(\'Afatome\').innerHTML= atomec + \" acheter\";\r\n    document.getElementById(\'Afplanet\').innerHTML= planetc + \" acheter\";\r\n\r\n\r\n    // affiche les modifications du prix\r\n\r\n    document.getElementById(\'Afautoadd\').innerHTML= autoadd + \" C\";\r\n    if(objmami == 1){\r\n    document.getElementById(\'Afmamiadd\').innerHTML= mamiadd + \" C\";\r\n    }\r\n    if(objferme == 1){\r\n    document.getElementById(\'Affermeadd\').innerHTML= fermeadd + \" C\";\r\n    }\r\n    if(objusine == 1){\r\n    document.getElementById(\'Afusineadd\').innerHTML= usineadd + \" C\";\r\n    }\r\n\r\n\r\n\r\n    if(objfactory == 1){\r\n    document.getElementById(\'Affactoryadd\').innerHTML= factoryadd + \" C\";\r\n    }\r\n    if(objcentrep == 1){\r\n    document.getElementById(\'Afcentrepadd\').innerHTML= centrepadd + \" C\";\r\n    }\r\n    if(objatome == 1){\r\n    document.getElementById(\'Afatomeadd\').innerHTML= atomeadd + \" C\";\r\n    }\r\n    if(objplanet == 1){\r\n    document.getElementById(\'Afplanetadd\').innerHTML= planetadd + \" C\";\r\n    }\r\n    \r\n    \r\n  }\r\nsetInterval(affiche,10);\r\n  \r\n// partie achat ou ce trouve tout les achat posible avec le montant a payer\r\nfunction auto(){\r\n  if(nb >= autoadd){\r\n  	autoc = autoc +1;\r\n 		nb = nb - autoadd;\r\n    autoadd = autoadd + 5;\r\n  }\r\n}\r\nfunction mami(){\r\n  if(nb >= mamiadd){\r\n  	mamic = mamic +1;\r\n 		nb = nb - mamiadd;\r\n    mamiadd = mamiadd +25;\r\n  }\r\n}\r\n  function ferme(){\r\n  if(nb >= fermeadd){\r\n  	fermec = fermec +1;\r\n 		nb = nb - fermeadd;\r\n    fermeadd = fermeadd + 500;\r\n  }\r\n}\r\n  function usine(){\r\n  if(nb >= usineadd){\r\n  	usinec = usinec +1;\r\n 		nb = nb - usineadd;\r\n    usineadd = usineadd + 5000\r\n  }\r\n}\r\n\r\n\r\nfunction factory(){\r\n  if(nb >= factoryadd){\r\n  	factoryc = factoryc +1;\r\n 		nb = nb - factoryadd;\r\n    factoryadd = factoryadd + 25000\r\n  }\r\n}\r\nfunction centrep(){\r\n  if(nb >= centrepadd){\r\n  	centrepc = centrepc +1;\r\n 		nb = nb - centrepadd;\r\n   centrepadd = centrepadd + 500000 \r\n  }\r\n}\r\nfunction atome(){\r\n  if(nb >= atomeadd){\r\n  	atomec = atomec +1;\r\n 		nb = nb - atomeadd;\r\n    atomeadd = atomeadd + 5000000\r\n  }\r\n}\r\nfunction planet(){\r\n  if(nb >= planetadd){\r\n  	planetc = planetc +1;\r\n 		nb = nb - planetadd;\r\n    planetadd = planetadd + 500000000\r\n  }\r\n}\r\n  // partie pour ajouter les cookie par seconde\r\n  function updateauto(){\r\n    nb = nb + (1*autoc);\r\n  }\r\n  function updatemami(){\r\n    nb = nb + (5*mamic);\r\n  }\r\n  function updateferme(){\r\n    nb = nb + (10*fermec);\r\n  }\r\n  function updateusine(){\r\n    nb = nb + (100*usinec);\r\n  }\r\n\r\n\r\n  function updatefactory(){\r\n    nb = nb + (500*factoryc);\r\n    \r\n  }  function updatecentrep(){\r\n    nb = nb + (1000*centrepc);\r\n    \r\n  }  function updateatome(){\r\n    nb = nb + (10000*atomec);\r\n    \r\n  }  function updateplanet(){\r\n    nb = nb + (1000000*planetc);\r\n    \r\n  }\r\n\r\n  // update tout les 1sec\r\n    setInterval(updateauto,1000);\r\n    setInterval(updatemami,1000);\r\n    setInterval(updateferme,1000);\r\n    setInterval(updateusine,1000);\r\n\r\n    setInterval(updatefactory,1000);\r\n    setInterval(updatecentrep,1000);\r\n    setInterval(updateatome,1000);\r\n    setInterval(updateplanet,1000);\r\n  \r\n  \r\n  \r\n  \r\n  //objectif\r\n  setInterval(check,500);\r\n  function check(){\r\n  if(autoc>=10 && objmami==0){\r\n    objmami = 1;\r\n    document.getElementById(\'obj1\').innerHTML= \'<button onclick=\"mami()\" style=\"width:100%;height:50px\" id=\"Afmamiadd\">50 C</button>\';\r\n  }\r\n  \r\n  if(mamic>=10 && objferme==0){\r\n    objferme = 1;\r\n    document.getElementById(\'obj2\').innerHTML= \'<button onclick=\"ferme()\" style=\"width:100%;height:50px\" id=\"Affermeadd\">1000 C</button>\';\r\n  }\r\n  \r\n  if(fermec>=10 && objusine==0){\r\n    objusine = 1;\r\n    doc